    # quit call -> destroy the given tk layer    
    def QuitAndGetEntries(self, layer, lowerThresholdEntries, lasingDurationEntries):
        
        self.lowerThresholdEntries = []
        self.lasingDurationEntries = []
        # get and save entries
        for i in range(len(lowerThresholdEntries)):
            self.lowerThresholdEntries.append(lowerThresholdEntries[i].get())
            self.lasingDurationEntries.append(lasingDurationEntries[i].get())
        
        # destroy the window that was entered
        layer.destroy()
