    # acceptorSlideCall -> receive the acceptor slide numbers       
    def acceptorSlideCall(self):
        
        # get the acceptor slide numbers
        for i in range(self.slidenumberLayer.numberOfAcceptorSlides):
            self.acceptorSlideNumbersLayer.acceptorSlideNumbers.append(self.acceptorWidgets[i].get())
        
        # destroy the previous layer
        self.getExcelFiles()
        self.Quit(self.acceptorSlideNumbersLayer)
