    # get root directory of the project -> setup a new one or open the existing
    def getRootDir(self, openOrNew):
        
        # user-defined root directory
        self.rootDirLayer.rootDir = filedialog.askdirectory(title = "Select a working directory")
        
        # destroy the previous layer
        # open the logfile information if the project exists
        if(openOrNew):
            self.Quit(self.rootDirLayer)
            self.showLogFile(1)
