    # get the working directory for the job file generation
    # get the user files (jpg) for the job file generation
    def getWorkingDir(self, mode):
        if mode == 2:
            self.jobFileWorkingDirectory = filedialog.askdirectory(title = "Select a working directory")
        elif mode == 3:
            self.jobFileJPG = filedialog.askdirectory(title = "Select an image directory")
        elif mode == 4:
            self.laserDESKfileFolder = filedialog.askdirectory(title = "Select a laserDESK file directory")
            self.fileNames = glob.glob(self.laserDESKfileFolder + "/*.sld")
        elif mode == 5:
            self.StackingfileFolder = filedialog.askdirectory(title = "Select a laserDESK file directory")
            self.fileNamesStaking = glob.glob(self.StackingfileFolder + "/*.tif")
        elif mode == 6:
            self.StackingProcessFolder = filedialog.askdirectory(title = "Select a working directory")
