    # get the user files (excel) for each acceptor slide
    def getExcelFiles(self):
        
        # user-defined excel files
        for i in range(self.slidenumberLayer.numberOfAcceptorSlides):
            tmp = filedialog.askopenfilename(initialdir = "/", title = ("Select Excel file %i" % ((i + 1))), filetypes = (("Excel files", "*.xlsx"), ("all files", "*.*")))
            self.rootDirLayer.ExcelFilenames.append(tmp)
            
        # get root directory (newCall)
        # build the project structure
        # create the logfile
        # show the logfile (newCall)
        self.getRootDir(0)
        self.makeStructure()
        self.createLogFile()
        self.showLogFile(0)
