    # show the logfile as GUI to the user
    def showLogFile(self, openOrNew):
        
        # change into the project directory and obtain the file structure information
        os.chdir(self.rootDirLayer.rootDir)
        structureData = []
        structure_fid = open('log_structure.txt', 'r')
        for row in structure_fid:
            structureData.append(int(row))
        structure_fid.close()
        
        # create all the necessary objects for the logfile
        if(openOrNew):
            self.logFileLayer = tk.Tk()
        else:
            self.logFileLayer = tk.Toplevel()
        self.logFileLayer.protocol('WM_DELETE_WINDOW', self.passCall)
        widthTmp = 125 + structureData[0] + 15 + structureData[1] + 15 + 70 + 15 + 150 
        self.logLabel = []
        self.logLabel1 = []
        self.logLabel2 = []        
        self.posLabel = []
        self.logCheck1 = []
        self.logCheck2 = []
        self.logCheckVar1 = []
        self.logCheckVar2 = []
        self.logFileLayer.slideState = []
        self.logFileLayer.nextLayer = []
        self.logFileRows = []
        j = 0
        
        # read out the logfile information and place all necessary objects
        fid = open('log.txt', 'r')
        for x in fid:
            self.logFileRows.append(x)
            idx = [m.start() for m in re.finditer('\t', x)]
            self.logCheckVar1.append(tk.IntVar())
            self.logCheckVar2.append(tk.IntVar())
            self.posLabel.append(tk.Label(self.logFileLayer, text = ('%i)' % (j + 1))))
            self.posLabel[j].place(x = 15, y = 50 + 50*j)
            self.logLabel.append(tk.Label(self.logFileLayer, text = x[:idx[0]]))
            self.logLabel[j].place(x = 125, y = 50 + 50*j)
            self.logLabel1.append(tk.Label(self.logFileLayer, text = x[idx[0]+1:idx[1]]))
            self.logLabel1[j].place(x = 125 + structureData[0] + 15, y = 50 + 50*j)
            self.logLabel2.append(tk.Label(self.logFileLayer, text = x[idx[1]:-1]))
            self.logLabel2[j].place(x = 125 + structureData[0] + 15 + structureData[1] + 15 - 47, y = 51 + 50*j) 
            self.logCheck1.append(tk.Checkbutton(self.logFileLayer, text = "", variable = self.logCheckVar1[j], onvalue = 1, offvalue = 0, height = 5, width = 1))
            self.logCheck1[j].place(x = 70, y = 20 + 50*j)
            self.logCheck2.append(tk.Checkbutton(self.logFileLayer, text = "next layer", variable = self.logCheckVar2[j], onvalue = 1, offvalue = 0, height = 5, width = 15))
            self.logCheck2[j].place(x = 125 + structureData[0] + 15 + structureData[1] + 15 + 70 + 15, y = 20 + 50*j)
            j = j + 1
        fid.close()
        self.logFileLayer.geometry(str(widthTmp) + "x" + "%i" % (500 - (4-j)*50))
        
        # create the static objects
        self.position = tk.Label(self.logFileLayer, text = 'Position')
        self.position.place(x = 0, y = 25)
        self.idLabel = tk.Label(self.logFileLayer, text = 'Acc-ID')
        self.idLabel.place(x = 125, y = 25)
        self.activeLabel = tk.Label(self.logFileLayer, text = 'Active')
        self.activeLabel.place(x = 75, y = 25)
        self.arrayLabel = tk.Label(self.logFileLayer, text = 'Array-Layer-Path')
        self.arrayLabel.place(x = 125 + structureData[0] + 15, y = 25)
        self.layerLabel = tk.Label(self.logFileLayer, text = 'Current Layer')
        self.layerLabel.place(x = 125 + structureData[0] + 15 + structureData[1] + 15, y = 25)
        self.logFileOkButton = tk.Button(self.logFileLayer, text="Start Laser Process", height = 10, width = 25, command = lambda: self.logFileCall(self.logCheckVar1, self.logCheckVar2))
        self.logFileOkButton.place(x = 125 + structureData[0] + 15 + structureData[1] + 15 + 70 + 15 - 50, y = 75 + 50*j)
        
        self.logFileLayer.mainloop()
