    # user-defined logfile information acceptor slide and next layer activation        
    def logFileCall(self, logCheckVar1, logCheckVar2):
        
        # get acceptor slide status and layer information
        for i in range(len(logCheckVar1)):
            self.logFileLayer.slideState.append(logCheckVar1[i].get())
            self.logFileLayer.nextLayer.append(logCheckVar2[i].get())
        
        # destroy the previous layers
        self.Quit(self.logFileLayer)
        self.Quit(self.acceptorSlideNumbersLayer)
