    # write the graphics random based sld file for the current AA           
    def graphicsRandomBasedJob(self, xCO, yCO, pitchFactor, lasingDurationLaserdesk, pointThreshold, algoChangeThreshold, fidLaserdesk, pitch, k):
        
        # randomize the given points
        tmpPointList = [(xCO[int(np.floor(random.random()*len(xCO)))], yCO[int(np.floor(random.random()*len(xCO)))]) for i in range(pointThreshold)]
        
        # prepare list for the random order
        xCOCopy = []
        yCOCopy = []
        while(len(xCO) > algoChangeThreshold):
            
            # get a random point
            # calculate the distance to every point in tmpPointList
            # skip this point if the previous points were to close
            # otherwise, adjust tmpPointList, fill the list with the new random order, and delete the transferred spots
            idx = int(np.floor(random.random()*len(xCO)))
            distTmp = np.asarray([np.sqrt((xCO[idx] - x)**2 + (yCO[idx] - y)**2) for (x, y) in tmpPointList])
            if np.any(distTmp < pitch/1000*pitchFactor):
                continue
            else:
                del tmpPointList[0]
                tmpPointList.append((xCO[idx], yCO[idx]))
                xCOCopy.append(xCO[idx])
                yCOCopy.append(yCO[idx])
                del xCO[idx]
                del yCO[idx]
        
        # write the spot to the sld file
        fidLaserdesk.write('<GraphicsPathsElement>\n')
        fidLaserdesk.write('<PointMarkDuration Value="%i" />\n' % int(lasingDurationLaserdesk[k-1]))
        fidLaserdesk.write('<IsBorder Value="False" />\n')
        fidLaserdesk.write('<ChildElements>\n')
        fidLaserdesk.write('<GraphicsPathsElement>\n')
        fidLaserdesk.write('<IsBorder Value="True" />\n')
        for m in range(len(xCOCopy)):
            fidLaserdesk.write('<GraphicPath>\n')
            fidLaserdesk.write('<Point X="%.4f" Y="%.4f" />\n' % (xCOCopy[m], yCOCopy[m]))
            fidLaserdesk.write('</GraphicPath>\n')
        fidLaserdesk.write('</GraphicsPathsElement>\n')
        fidLaserdesk.write('</ChildElements>\n')
        fidLaserdesk.write('</GraphicsPathsElement>\n')
        
        return np.asarray(xCO), np.asarray(yCO)
